import React from 'react'
import PropTypes from 'prop-types'
import ViberIcon from '../../images/Social/viber.svg'
import TelegramIcon from '../../images/Social/telega.svg'
import InstagramIcon from '../../images/Social/instagram.svg'
import FacebookIcon from '../../images/Social/facebook.svg'

const SocialIcon = props => {
  let Icon

  if (props.icon.acf.social_svg_path == 'viber')
    Icon = ViberIcon
  else if (props.icon.acf.social_svg_path == 'telega')
    Icon = TelegramIcon
  else if (props.icon.acf.social_svg_path == 'facebook')
    Icon = FacebookIcon
  else if (props.icon.acf.social_svg_path == 'instagram')
    Icon = InstagramIcon

  return (
    <div>
      {Icon}
    </div>
  )
}

SocialIcon.propTypes = {

}

export default SocialIcon
